import React, { useState } from "react";
import {
  Box,
  Tabs,
  Tab,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableRow,
  Button,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  TextField,
  TableContainer,
  TableHead,
  Paper,
} from "@mui/material";

const ProjectInfo = () => {
  const [activeTab, setActiveTab] = useState(0);
  const [members, setMembers] = useState([
    { id: 55, name: "Đỗ Quang Bắc Kỳ", email: "ky.dqb226111@sis.hust.edu.vn", role: "member", status: "Registered", joinedAt: "2024-10-21 12:00:17" },
    { id: 47, name: "Nguyễn Quốc Khánh", email: "khanh.nq235118@sis.hust.edu.vn", role: "member", status: "Registered", joinedAt: "2024-10-08 21:40:15" },
    { id: 38, name: "Phạm Đức Mạnh", email: "manh.pd225361@sis.hust.edu.vn", role: "member", status: "Registered", joinedAt: "2024-10-08 21:40:15" },
  ]);
  const [openAddDialog, setOpenAddDialog] = useState(false);
  const [newMember, setNewMember] = useState({ name: "", email: "" });

  const handleChangeTab = (event, newValue) => {
    setActiveTab(newValue);
  };

  const handleAddDialogOpen = () => {
    setOpenAddDialog(true);
  };

  const handleAddDialogClose = () => {
    setOpenAddDialog(false);
    setNewMember({ name: "", email: "" });
  };

  const handleAddMember = () => {
    if (newMember.name && newMember.email) {
      setMembers([
        ...members,
        {
          id: members.length + 1,
          name: newMember.name,
          email: newMember.email,
          role: "member",
          status: "Registered",
          joinedAt: new Date().toISOString(),
        },
      ]);
      handleAddDialogClose();
    }
  };

  const projectData = {
    name: "Project 1",
    creator: "BKCS SOICT",
    organization: "SoICT",
    createdAt: "2024-09-30 14:09:29",
    numberOfMembers: members.length,
    numberOfTasks: 41,
    description:
      "Củng cố và mở rộng kiến thức chuyên môn, liên kết kiến thức của một nhóm học phần. Khuyến khích sinh viên phát triển kỹ năng chuyên nghiệp, năng lực làm việc theo nhóm.",
  };

  return (
    <Box>
      <Tabs value={activeTab} onChange={handleChangeTab} indicatorColor="primary" textColor="primary">
        <Tab label="Info" />
        <Tab label="Members" />
        <Tab label="Tasks" />
      </Tabs>

      {activeTab === 0 && (
        <Box p={4}>
          <Typography variant="h5" mb={2}>
            Project Information
          </Typography>
          <Table>
            <TableBody>
              <TableRow>
                <TableCell variant="head">Name</TableCell>
                <TableCell>{projectData.name}</TableCell>
                <TableCell variant="head">Creator</TableCell>
                <TableCell>{projectData.creator}</TableCell>
              </TableRow>
              <TableRow>
                <TableCell variant="head">Organization</TableCell>
                <TableCell>{projectData.organization}</TableCell>
                <TableCell variant="head">Created at</TableCell>
                <TableCell>{projectData.createdAt}</TableCell>
              </TableRow>
              <TableRow>
                <TableCell variant="head">Number of members</TableCell>
                <TableCell>{projectData.numberOfMembers}</TableCell>
                <TableCell variant="head">Number of tasks</TableCell>
                <TableCell>{projectData.numberOfTasks}</TableCell>
              </TableRow>
              <TableRow>
                <TableCell colSpan={4} variant="head">
                  Description
                </TableCell>
              </TableRow>
              <TableRow>
                <TableCell colSpan={4}>{projectData.description}</TableCell>
              </TableRow>
            </TableBody>
          </Table>
        </Box>
      )}

      {activeTab === 1 && (
        <Box p={4}>
          <Typography variant="h5" mb={2}>
            Members
          </Typography>
          <Button variant="contained" color="primary" onClick={handleAddDialogOpen} sx={{ mb: 2 }}>
            Add People
          </Button>
          <TableContainer component={Paper}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>ID</TableCell>
                  <TableCell>Name</TableCell>
                  <TableCell>Email</TableCell>
                  <TableCell>Role</TableCell>
                  <TableCell>Status</TableCell>
                  <TableCell>Joined At</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {members.map((member) => (
                  <TableRow key={member.id}>
                    <TableCell>{member.id}</TableCell>
                    <TableCell>{member.name}</TableCell>
                    <TableCell>{member.email}</TableCell>
                    <TableCell>{member.role}</TableCell>
                    <TableCell>{member.status}</TableCell>
                    <TableCell>{member.joinedAt}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>

          {/* Dialog thêm thành viên */}
          <Dialog open={openAddDialog} onClose={handleAddDialogClose}>
            <DialogTitle>Add New Member</DialogTitle>
            <DialogContent>
              <TextField
                label="Name"
                fullWidth
                value={newMember.name}
                onChange={(e) => setNewMember({ ...newMember, name: e.target.value })}
                sx={{ mb: 2 }}
              />
              <TextField
                label="Email"
                fullWidth
                value={newMember.email}
                onChange={(e) => setNewMember({ ...newMember, email: e.target.value })}
              />
            </DialogContent>
            <DialogActions>
              <Button onClick={handleAddDialogClose}>Cancel</Button>
              <Button variant="contained" color="primary" onClick={handleAddMember}>
                Add
              </Button>
            </DialogActions>
          </Dialog>
        </Box>
      )}

      {activeTab === 2 && (
        <Box p={4}>
          <Typography variant="h5" mb={2}>
            Tasks
          </Typography>
          <Typography>Danh sách các nhiệm vụ sẽ hiển thị tại đây.</Typography>
        </Box>
      )}
    </Box>
  );
};

export default ProjectInfo;
